import React from 'react';
import { Text, StyleSheet, SafeAreaView,View, TouchableOpacity } from 'react-native';
import BottleTable from "../components/BottleTable"
import SwitchTripView from "../components/SwitchTripView"
import { Avatar, Button, Card, Title, Paragraph } from 'react-native-paper'
const LeftContent = props => <Avatar.Icon {...props} icon="folder" />
const styles = StyleSheet.create({
  container: {
      flex: 1,
    },
    container2: {
    //   flex: 1,
      flexDirection: 'row',
      marginTop: 20, 
    }
});

let vals = []
vals.push({'name': 'Bob', 'loc':'Hyderabad'})
vals.push({'name': 'Kev', 'loc':'Trivandrum'})



export default class UpcomingDelScreen extends React.Component{
    constructor(props) {
        super(props);
      }

    render(){
      console.log(vals)
        return(
            <View style={styles.container}>
                <BottleTable/>
                <SwitchTripView navigation={this.props.navigation}/>
                <Card>
                  <Card.Title title="Card Title" subtitle="Card Subtitle" left={LeftContent} />
                  <Card.Content>
                    {/* <Title>Card title</Title> */}
                    {/* <Paragraph>Card content</Paragraph> */}
                  </Card.Content>
                  {/* <Card.Cover source={{ uri: 'https://picsum.photos/700' }} /> */}
                  <Card.Actions>
                    <Button>Cancel</Button>
                    <Button>Ok</Button>
                  </Card.Actions>
                </Card>
            </View>
        )
    }

}
